O Ajax da temporada 2018/19, foi a sensação da Europa, com um futebol ofensivo e com muitos garotos no time titular, o time terminou a temporada com o melhor ataque da Europa totalizando 175 gols.
Na Eredivisie, o Ajax terminou como o vencedor da competição, com 28 vitórias, 2 empates e 4 derrotas em 34 jogos, totalizando 86 pontos. Marcou 119 gols e sofreu 32, terminou 3 pontos a frente do rival PSV que ficou na 2ª colocação.
A equipe de ten Hag também venceu a KNVB, equivalente a copa da Holanda. O Ajax tirou o HVV Te Werve, Go Ahead Eagles, Roda JC, Heerenveen e o Feyenoord, até chegar na final e golear o Willem por 4x0.
Na Champions League, o Ajax superou todas as expectativas, começou o campeonato passando pela pré Champions League, onde tirou o Sturm Graz e Standard de Liège. 
Na fase de grupos, caiu no grupo E com Bayern de Munique, Benfica e AEK Atenas. Empatou os dois jogos com o Bayern, venceu os dois com o AEK Atenas e venceu um com o Benfica e empatou o outro. Totalizando 12 pontos e um término na 2ª colocação do grupo.
Nas oitavas, pegou o Real Madrid, atual tricampeão da época. O Ajax perdeu o jogo de ida em casa por 2x1, porém em Madrid a equipe holandesa conseguiu uma remontada histórica e venceu por 4x1.
Nas quartas, pegou a Juventus. Empatou o primeiro jogo em casa, mas em Turim venceu por 2x1 e se classificou para as semis.
Pegou o Spurs e conseguiu vencer o primeiro jogo fora de casa por 1x0. A um passo da final, o Ajax teria que jogar em casa para garantir a classificação. Marcou 2 gols só no primeiro tempo e poucos acreditavam na virada do Spurs, porém ela aconteceu. O Tottenham marcou 3 gols e se classificou para a final. O Ajax estava classificado até aos 89 minutos do jogo, quando Lucas Moura marca o seu terceiro gol na partida e eliminou o Ajax da competição.
